import axios from "axios";
import "../styles/List.css";
import { useState, useEffect } from "react";
import BrewCard from "../components/BrewCard";

// data-types: brewery_type, city, country, id, name, phone, latitude, longitude, postal_code, state, street, website_url

const List = () => {
  const [brew, setBrew] = useState([]);

  useEffect(() => {
    const getBrew = async () => {
      let newBrew = await axios.get(
        "https://api.openbrewerydb.org/breweries?by_city=atlanta"
      );
      setBrew(newBrew.data);
    };
    getBrew();
  }, []);

  console.log(brew);

  return brew.length > 1 ? (
    <div className={`main-bg-color list-container`}>
      {brew.map((beer) => {
        <BrewCard
          key={beer.id}
          type={beer.brewery_type}
          city={beer.city}
          country={beer.country}
          name={beer.name}
          phone={beer.phone}
          latitude={beer.latitude}
          longitude={beer.longitude}
          zip={beer.postal_code}
          state={beer.state}
          street={beer.street}
          url={beer.website_url}
        />;
      })}
    </div>
  ) : (
    <div>Loading</div>
  );
};

export default List;
